def is_square(n):
    return int(n ** 0.5) ** 2 == n


def continued_fraction_period(n):
    a0 = int(n ** 0.5)
    a1 = 1
    b1 = n - a0 ** 2
    period = 0
    while True:
        a2 = int((a0 + a1) / b1)
        b2 = n - a2 ** 2 * b1
        if a2 == a1 and b2 == b1:
            break
        a0, a1, b0, b1 = a1, a2, b1, b2
        period += 1
    return period


